import axios from 'axios';
import { config } from '../config';

export default {

    Signup: (obj) => {
        console.log("data");
        return axios.post(config.baseApiUrl + "api/signup",obj)
        .then(response => {
            return response;
        }).catch({ status: 500, message: 'Internal Server Error' });
    }
 }
